","metadata":{}},{"cell_type":"markdown","source":"- From our above result, we observe many positive words like “good”, “happy”, “love” etc. In the next step, we will use the spread() function to segregate our data into separate columns of positive and negative sentiments. We will then use the mutate() function to calculate the total sentiment, that is, the difference between positive and negative sentiment.","metadata":{}},{"cell_type":"code","source":"library(tidyr)\nbing <- get_sentiments(\"bing\")\nEmma_sentiment <- tidy_data %>%\n inner_join(bing) %>%\n count(book = \"Emma\" , index = linenumber %/% 80, sentiment) %>%\n spread(sentiment, n, fill = 0) %>%\n mutate(sentiment = positive - negative)","metadata":{"execution":{"iopub.status.busy":"2023-07-16T17:24:25.812781Z","iopub.execute_input":"2023-07-16T17:24:25.816103Z","iopub.status.idle":"2023-07-16T17:24:26.644175Z"},"trusted":true},"execution_count":8,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22mJoining, by = \"word\"\n","output_type":"stream"}]},{"cell_type":"markdown","source":"# Visualize the words present in the book","metadata":{}},{"cell_type":"markdown","source":"### we will visualize the words present in the book “Emma” based on their corresponding positive and negative scores:","metadata":{}},{"cell_type":"code","source":"library(ggplot2)\nggplot(Emma_sentiment, aes(index, sentiment, fill = book)) +\n geom_bar(stat = \"identity\", show.legend = TRUE) +\n facet_wrap(~book, ncol = 2, scales = \"free_x\")","metadata":{"execution":{"iopub.status.busy":"2023-07-16T17:24:26.648457Z","iopub.execute_input":"2023-07-16T17:24:26.651Z","iopub.status.idle":"2023-07-16T17:24:27.820564Z"},"trusted":true},"execution_count":9,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5hcVd0H8DNl+26ymw3SRUILVUEFUYqRoKKAIiAgLSAgGEAFQ5EYQ2jSEYUX\nxAK+AgFFXkGUqhAQFEUQsQCCFGmB1E3ZPu8fA8uyu9mdTGZ2Zs9+Po+Pz8y9d8793Zov5969